import './BoxScoreItem.css'

function BoxScoreItem() {
  return (
    <div className="">
      <div>March 28th 2021</div>
      <div>
        <div>Timberwolves</div>
        <h2>Jimmy Butler</h2>
        <div>29 Points</div>
      </div>
    </div>
  );
}

export default BoxScoreItem;
